商品詳細<BR>
<font size="+2">LEDフォグランプユニット トヨタ車汎用</font><BR>
<BR>
■LEDイカリング搭載<BR>
フロントビューをスタイリッシュに印象的な姿に変える<BR>
ドレスアップ効果大！<BR>
<BR>
■的確な配光パターン<BR>
LEDを均等に配置し、インナーメッキが光を拡散させる事により、<BR>
フォグランプとして効率的で的確な配光となっております。<BR>
<BR>
■優れた機能性<BR>
高硬度強化ガラスレンズ＆インナーメッキ仕様<BR>
優れた耐熱性・衝撃耐性・透光率でLEDを保護。<BR>
高級感あるクリスタルメッキ仕様ですので、点灯時、不点灯時どちらも存在感は抜群です。<BR>
<BR>
■簡単取り付け可能<BR>
純正のフォグユニットと同じ形状ですので、同形状であれば簡単に取付が可能です。<BR>
カプラーに接続し、＋側をポジション、－側をアースへ接続します。<BR>
<BR>
◆セット内容◆<br>
   LEDフォグユニット…左右2個1セット<br>
   <BR> 
◆仕様◆<BR>              
 LEDフォグ：ホワイト(片側18W 合計36W仕様)<br>
LEDイカリング：ブルー<br>
・強化ガラスレンズ採用<br>
・インナーメッキ仕様<br>
・純正交換タイプ<br>
・カプラーオン<br>
<br>
